2-1. AccountTrigger.trigger のコードカバー率を向上させるために起動条件を追加します。
安心してください、カスタムメタデータ型で制御しているため実際の動作には影響ありません。
trigger AccountTrigger on Account(
  before insert,
  before update,
  before delete,
  after insert,
  after update,
  after delete,
  after undelete
) {
  FAT_CommonTriggerHandler handler = FAT_CommonTriggerHandler.create(
    Account.class
  );
  handler.invoke();
}

