@isTest(SeeAllData=false)
public with sharing class AccountTestUtils {
  public static List createNormalAccounts() {
    List accounts = new List();

    Account account1 = new Account();
    account1.Name = 'Demo';
    account1.Rating = 'Hot';
    accounts.add(account1);

    return accounts;
  }

  public static List selectAccounts() {
    return [
      SELECT Id, Name, Rating, CustomerPriority__c
      FROM Account
      ORDER BY Name ASC
      LIMIT 50000
    ];
  }

  public static void insertAccounts(List accounts) {
    List results = Database.insert(accounts, false);
  }

  public static void updateAccounts(List accounts) {
    List results = Database.update(accounts, false);
  }

  public static void deleteAccounts(List accounts) {
    List results = Database.delete(accounts, false);
  }

  public static void undeleteAccounts(List accounts) {
    List results = Database.undelete(accounts, false);
  }
}

