...いかがでしょう、だいぶテストクラスが書きやすくなっていませんか？
もしも Apex トリガからビジネスロジックを分離していなかったら、ビジネスロジックをテストするためにわざわざ insert などして無理やり Apex トリガを起動させないといけませんでした。
今回はビジネスロジックに集中してテストコードを書けば良くなっているので、ちゃんと細かく単体テストしてる気持ちになれるのではないでしょうか。
もしビジネスロジックが複雑になったとしても、ホワイトボックステストを書きやすいですよね。
